in c_Telefono VARCHAR(15), in c_Telefono2 VARCHAR(15), in c_Correo VARCHAR(40), in c_DireccionColegio VARCHAR(50),
in c_Comuna INT(11), in c_CodigoBarrio VARCHAR(10), in c_Barrio VARCHAR(50))
